selector_to_html = {"a[href=\"#enkelt-logaritmisk-koordinatsytem\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6.1.1. </span>Enkelt-logaritmisk koordinatsytem<a class=\"headerlink\" href=\"#enkelt-logaritmisk-koordinatsytem\" title=\"Permalink til denne overskrift\">#</a></h3><p>I et enkelt-logaritmisk koordinatsystem er det kun den ene af de to akser, der log-transformeres. Lad os starte med at betragte hvad der sker, n\u00e5r vi log-transformerer vores <span class=\"math notranslate nohighlight\">\\(y\\)</span>-akse. Husk, det er kun positive <span class=\"math notranslate nohighlight\">\\(y\\)</span>-v\u00e6rdier, som vi kan log-transformere. Det vil derfor kun v\u00e6re muligt at betragte log-transformationen i f\u00f8rste og anden kvadrant i et koordinatsystem.</p>", "a[href=\"#simpel-eksponentiel-regression\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6.2. </span>Simpel eksponentiel regression<a class=\"headerlink\" href=\"#simpel-eksponentiel-regression\" title=\"Permalink til denne overskrift\">#</a></h2><p>Skal vi fitte en eksponentiel regression p\u00e5 vores data, s\u00e5 vil den fittede kurve have formen</p>", "a[href=\"#simpel-potens-regression\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6.3. </span>Simpel potens regression<a class=\"headerlink\" href=\"#simpel-potens-regression\" title=\"Permalink til denne overskrift\">#</a></h2><p>Skal vi fitte en potens regression p\u00e5 vores data, s\u00e5 vil den fittede kurve have formen</p>", "a[href=\"#logaritmiske-koordinatsystemer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6.1. </span>Logaritmiske koordinatsystemer<a class=\"headerlink\" href=\"#logaritmiske-koordinatsystemer\" title=\"Permalink til denne overskrift\">#</a></h2><p>Lad os starte med at huske, hvordan vi definerede en klasse af logaritmer <span class=\"math notranslate nohighlight\">\\(\\log_a\\)</span> i Kapitel 1.xx</p>", "a[href=\"#ex-eksponentiel-regression\"]": "<div class=\"proof eksempel admonition\" id=\"ex-eksponentiel-regression\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 25.6 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi \u00f8nsker at modellere befolkningsv\u00e6ksten i en by, hvor vi har f\u00f8lgende data over tid:</p>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>\u00c5r</p></th>\n<th class=\"head\"><p>Befolkning</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>0</p></td>\n<td><p>500</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>1</p></td>\n<td><p>751</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>2</p></td>\n<td><p>1152</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>3</p></td>\n<td><p>1732</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>4</p></td>\n<td><p>2681</p></td>\n</tr>\n</tbody>\n</table>\n<p>N\u00e5r vi inds\u00e6tter ovenst\u00e5ende data i et almindeligt koordinatsystem, bliver det tydeligt, at en line\u00e6r regression direkte p\u00e5 data ikke giver mening. Betragter vi data i et enkelt-logaritmisk koordinatsystem, hvor <span class=\"math notranslate nohighlight\">\\(y\\)</span>-aksen er log-transformeret, da ses tydelig en line\u00e6r tendens.</p>\n<figure class=\"align-default\">\n<img alt=\"../../../_images/272f386b115e1372d2423dabdf008124e6f8937902f68a7ebae4b9424c526670.png\" src=\"../../../_images/272f386b115e1372d2423dabdf008124e6f8937902f68a7ebae4b9424c526670.png\"/>\n</figure>\n<p>Det giver derfor mening at fitte en eksponentiel model p\u00e5 den oprindelige data <span class=\"math notranslate nohighlight\">\\((x_i,y_i)\\)</span> - eller snarere, en line\u00e6r model p\u00e5 vores log-transformeret data <span class=\"math notranslate nohighlight\">\\((x_i,\\log(y_i))\\)</span>. Vi husker, at denne har formen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\tilde{y} = \\beta_0 + \\beta_1 x,\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(\\tilde{y} = \\log(y)\\)</span>. Ved brug af mindste kvadraters metode, finder vi</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\beta_0 \\approx 2{,}721, \\qquad \\beta_1 \\approx 0{,}174.\\]</div>\n<p>Med disse parametre kan vi finde de oprindelige parametre <span class=\"math notranslate nohighlight\">\\(b\\)</span> og <span class=\"math notranslate nohighlight\">\\(a\\)</span>:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    b = 10^{\\beta_0} \\approx 10^{2{,}721} \\approx 526{,}017,\\qquad a = 10^{\\beta_1} \\approx 10^{0{,}174} \\approx 1{,}493.\\]</div>\n<p>Dette giver os den eksponentielle model</p>\n<div class=\"math notranslate nohighlight\">\n\\[    f(x) = 526{,}017 \\cdot 1{,}493^x\\]</div>\n<p>for vores oprindelige data. Nedenfor ses den fittede kurve indsat p\u00e5 vores oprindelige data:</p>\n<figure class=\"align-default\">\n<img alt=\"../../../_images/dcae44fbcb1708fd032a0c798ea4e159e8978cc7b0f5dff5d00acd384f3d9d5e.png\" src=\"../../../_images/dcae44fbcb1708fd032a0c798ea4e159e8978cc7b0f5dff5d00acd384f3d9d5e.png\"/>\n</figure>\n<p>Vi kan nu bruge modellen til at forudsige befolkningen i fremtiden. Med modellen f\u00e5r vi, at befolkningen vil v\u00e6re ca. 5.821 efter seks \u00e5r:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    f(6) = 526{,}017 \\cdot 1{,}493^6 \\approx 5821.\\]</div>\n</section>\n</div>", "a[href=\"#simpel-ikke-lineaer-regression\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6. </span>Simpel ikke-line\u00e6r regression<a class=\"headerlink\" href=\"#simpel-ikke-lineaer-regression\" title=\"Permalink til denne overskrift\">#</a></h1><p>Vi vil i dette kapitel unders\u00f8ge, n\u00e5r en line\u00e6r model ikke er nok til at forklare sammenh\u00e6ngen mellem to variabler. Her vil vi se nyttigheden i at kigge p\u00e5 <em>log-transformeret</em> data, hvilket betyder, at vi tager logaritmen p\u00e5 vores observationer i data. Vi vil se, at hvis vi observerer en line\u00e6r sammenh\u00e6ng i vores data, hvor vi kun log-transformerer <span class=\"math notranslate nohighlight\">\\(y\\)</span>-v\u00e6rdierne, s\u00e5 vil en eksponentiel regressionsmodel v\u00e6re passende, hvorimod hvis vi log-transformerer b\u00e5de <span class=\"math notranslate nohighlight\">\\(x\\)</span>-v\u00e6rdierne og <span class=\"math notranslate nohighlight\">\\(y\\)</span>-v\u00e6rdierne, s\u00e5 vil en potens regressionsmodel v\u00e6re passende. Dette leder os naturligt ind p\u00e5 logaritmiske koordinatsystemer.</p>", "a[href=\"#eulers-konstant-som-grundtal\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6.2.1. </span>Eulers konstant som grundtal<a class=\"headerlink\" href=\"#eulers-konstant-som-grundtal\" title=\"Permalink til denne overskrift\">#</a></h3><p>I <a class=\"reference internal\" href=\"../Eksponentialfunktionen/eksponentialfunktionen.html#ch-eksponentialfunktionen\"><span class=\"std std-numref\">Kapitel 15</span></a> l\u00e6rte vi om Eulers konstant <span class=\"math notranslate nohighlight\">\\(\\text{e}\\)</span>, der sammen med den naturlige logaritme <span class=\"math notranslate nohighlight\">\\(\\ln\n\\)</span>, danner basis for nogle helt s\u00e6rlige funktioner. Oftest, n\u00e5r matematikere snakker om eksponentialfunktionen, s\u00e5 vil <span class=\"math notranslate nohighlight\">\\(\\text{e}\\)</span> v\u00e6re grundtallet. Det viser sig i mellemtiden, at vi ret nemt kan g\u00e5 mellem den generelle eksponentialfunktion, <span class=\"math notranslate nohighlight\">\\(f(x)=ba^x\\)</span>, hvor <span class=\"math notranslate nohighlight\">\\(a&gt;0\\)</span>, og eksponentialfunktionen med <span class=\"math notranslate nohighlight\">\\(\\text{e}\\)</span> som grundtal.</p><p>Lader vi <span class=\"math notranslate nohighlight\">\\(a=\\text{e}^k\\)</span>, hvor <span class=\"math notranslate nohighlight\">\\(k\\in\\mathbb{R}\\)</span>, s\u00e5 kan vi altid omskrive den generelle eksponentialfunktion til en med <span class=\"math notranslate nohighlight\">\\(\\text{e}\\)</span> som grundtal. Husk, at funktionen <span class=\"math notranslate nohighlight\">\\(f(x)=\\text{e}^x&gt;0\\)</span> for alle <span class=\"math notranslate nohighlight\">\\(x\\in\\mathbb{R}\\)</span>. Derfor er identiteten <span class=\"math notranslate nohighlight\">\\(a=\\text{e}^k\\)</span> valid. Inds\u00e6tter vi <span class=\"math notranslate nohighlight\">\\(a=\\text{e}^k\\)</span> i <span class=\"math notranslate nohighlight\">\\(f(x)=ba^x\\)</span> f\u00e5s:</p>", "a[href=\"#dobbelt-logaritmisk-koordinatsystem\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.6.1.2. </span>Dobbelt-logaritmisk koordinatsystem<a class=\"headerlink\" href=\"#dobbelt-logaritmisk-koordinatsystem\" title=\"Permalink til denne overskrift\">#</a></h3><p>I et dobbelt-logaritmisk koordinatsystem er det begge akser, der log-transformeres. Vi kan i dette tilf\u00e6lde kun log-transformere positive <span class=\"math notranslate nohighlight\">\\(x\\)</span>- og <span class=\"math notranslate nohighlight\">\\(y\\)</span>-v\u00e6rdier. Det vil derfor kun v\u00e6re muligt at betragte log-transformationen i f\u00f8rste kvadrant i koordinatsystemet.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
